import React from "react";
import Button from "@mui/material/Button";
import { useNavigate } from "react-router";
import { Card } from "react-bootstrap";
import { motion } from "framer-motion";
import TextField from "@mui/material/TextField";

const SignIn = () => {
  const navigate = useNavigate();

  const GoToSignUp = () => {
    navigate("/signup");
  };

  const GoToForgotPassword=()=>{
    navigate("/forgotpassword");
  };

  const GoToMemberPage = () => {
    navigate("/memberpage");
  };

  return (
    <div className="background_signin">
      <motion.div
        initial={{ y: "5vh" }}
        animate={{ y: 0 }}
        transition={{ duration: 1, type: "spring", stiffness: 100 }}
      >
        <Card
          border="success"
          style={{ width: "24rem" }}
          className="card_signin"
        >
          <Card.Header className="cityty_style">Cityty</Card.Header>
          <Card.Body style={{ width: "18rem" }}>
            <TextField
              id="email"
              size="normal"
              label="Enter email"
              variant="filled"
              fullWidth
              margin="normal"
            />
            <TextField
              id="password"
              label="Enter password"
              size="normal"
              type="password"
              autoComplete="current-password"
              variant="filled"
              fullWidth
              margin="normal"
            />
            <div className="container-button_form">
              <div className="button_form">
                <Button variant="text" margin="normal" fullWidth  onClick={() => GoToForgotPassword()}>
                  Forgot Password ?
                </Button>
              </div>
              <div className="button_form">
                <Button
                  variant="contained"
                  margin="normal"
                  onClick={() => GoToMemberPage()}
                  fullWidth
                  color="success"
                >
                  Sign In
                </Button>
              </div>

              <div className="button_form">
                <Button
                  variant="contained"
                  margin="normal"
                  onClick={() => GoToSignUp()}
                  fullWidth
                  color="info"
                >
                  Sign Up
                </Button>
              </div>
            </div>
          </Card.Body>
        </Card>
      </motion.div>
    </div>
  );
};

export default SignIn;
